import React, { Component } from 'react';
import './App.css';
import axios from 'axios'
import Navigation from './components/Navigation';
import HomePage from './pages/HomePage';
import Card from './components/Cards';
import Test from './components/Test'
import Cards from "./components/Cards"

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import BrowsePage from './pages/BrowsePage';
import AboutPage from './pages/AboutPage';
import BasketPage from './pages/BasketPage';
import ItemvViewPage from './pages/ItemViewPage';

class App extends Component {
  constructor() {
    super()
    this.state = {
      response: {},
      data: []
    }
  }

  getCard(idToGet) {
    axios.get('/api/v1/say-something', {params: {AlbumID:idToGet}}).then((res) => {
      const responseData = res.data.selected;
      console.log("HELLO", res.data.selected[0])
      this.setState({
        data: responseData.map(item => <Cards key={item.id} item={item}/>)
      });

    });
  }

  componentDidMount() {
    //this.getCard("5")
  }

  render() {
    return (
      <div className="App">

       <Router>
        <Navigation />

          {/*
            A <Switch> looks through all its children <Route>
            elements and renders the first one whose path
            matches the current URL. Use a <Switch> any time
            you have multiple routes, but you want only one
            of them to render at a time
          */}
          <Switch>
            <Route exact path="/" component={HomePage}/>
            <Route exact path="/Browse" component={BrowsePage}/>
            <Route exact path="/About" component={AboutPage}/> 
            <Route exact path="/Basket" component={BasketPage}/> 
            <Route exact path="/AlbumView/:musicianId/:albumId/:albumName"   component={ItemvViewPage}/>
            <Route exact path="/Test/:albumId/:albumName"  component={Test}/> 
          </Switch>
        </Router>



        <h1>Hello from the frontend!</h1>
       {/* <h1>{this.state.genre}</h1>
        <p>{this.state.data}</p>*/}

      </div>
    );
  }
}

export default App;
